import React from 'react';
import {Container,AppBar,Typography,Grow,Grid} from '@material-ui/core';
import souvenir from './images/souvenir.png';

const App=()=>{
    return(
        <Container maxWidth="lg">
          <AppBar position='static' color='inherit'>
           <Typography varient="h2" align='center'>Souvenir</Typography>
           <img src={souvenir} alt="souvenir" height="60"></img>
          </AppBar>
          <Grow>
            <Container>
                <Grid container justify='space-between' alignItems='stretch'></Grid>
            </Container>
          </Grow>
        </Container>
    )
}

export default App;
